window.bookSummaryJSON = "<p><b>Fight to build a free world. Face new enemies. Slay new monsters. Meet new women. </b></p> <p>With Aristine at his side, Eden Chain technology will connect Jack's new people as they get ready to go to war, but Kassos - the city of intrigue and fear - is not what it seems.&nbsp;</p> <p>There's a new threat in the region, known as the Procurators, and they are using the past against Jack and his people - nanobots.&nbsp;</p> <p>War is coming, and Jack is determined to win at all costs.&nbsp;</p> <p><b>Warning:</b> This story contains adult situations, coarse language, and other fun things. Listen at your own risk.</p>"; 
